import styled from 'styled-components'

export const ContainerMoviePrincipal = styled.div`
margin: 10px;
display: inline-block;
overflow-x: hidden;

`

export const ContainerMovie = styled.div`
margin: 10px;

img {
    width: 150px;
}
`


export const Img = styled.img`
width: 150px;
`
